export default function Menu () {
    return(
        <Navbar
  alignLinks="right"
  brand={<a className="brand-logo" href="#">Logo</a>}
  id="mobile-nav"
  menuIcon={<Icon>menu</Icon>}

  sidenav={<li>Custom node!</li>}
>
